import { Component } from '@angular/core';
import { faAt } from '@fortawesome/free-solid-svg-icons';
import { faGithub } from '@fortawesome/free-brands-svg-icons';
import { faLinkedin } from '@fortawesome/free-brands-svg-icons';

@Component({
  selector: 'app-links',
  templateUrl: './links.component.html',
  styleUrls: ['./links.component.scss'],
})
export class LinksComponent {
  faAt = faAt;
  faGithub = faGithub;
  faLinkedin = faLinkedin;
}
<ul>
  <li>
    <a href="https://www.linkedin.com/in/ren%C3%A0ta-irinyi-b69532267/">
      <fa-icon class="svg" [icon]="faLinkedin"></fa-icon>
    </a>
  </li>
  <li>
    <a href="https://github.com/ReniIrinyi">
      <fa-icon class="svg" [icon]="faGithub"></fa-icon>
    </a>
  </li>
  <li>
    <a href="mailto:reniirinyi@icloud.com">
      <fa-icon class="svg" [icon]="faAt"></fa-icon>
    </a>
  </li>
</ul>
